import React, { Component } from 'react'
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBIcon } from 'mdbreact';
import axios from 'axios'
import { MDBRow, MDBCol, MDBCard, MDBCardBody, MDBMask, MDBView, MDBBtn } from "mdbreact";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Inscription from "./inscription"
import Acceuil from "./listeAtelier"

export default class Particulier extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collapse: false,
            atelier: ""
        };
        this.onClick = this.onClick.bind(this);
    }

    onClick() {
        this.setState({
            collapse: !this.state.collapse,
        });
    }
    componentDidMount() {
        this.getAtelier()
    }

    getAtelier() {
        axios.get("http://localhost:8080/getAtelier")
            .then(resp => {
                this.setState({ atelier: resp.data })
                console.log(resp);

            }).catch(err => {
                console.log(err);

            })
    }
    inscr() {

    }

    render() {
        const bgPink = { backgroundColor: '#e91e63' }
        const container = { height: 1300 }
        return (
            <div>
                <Router>
                    <div>
                        <nav class="navbar navbar-expand-lg navbar-dark bg-dark static-top">
                            <div class="container">
                                <a class="navbar-brand" href="#">
                                    <img src="http://placehold.it/150x50?text=Logo" alt="" />
                                </a>
                                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                                    <span class="navbar-toggler-icon"></span>
                                </button>
                                <div class="collapse navbar-collapse" id="navbarResponsive">
                                    <ul class="navbar-nav ml-auto">
                                        <li class="nav-item active">
                                            <Link class="nav-link" exact to="/">Home
                                    <span class="sr-only">(current)</span>
                                            </Link>
                                        </li>
                                        <li class="nav-item">
                                            <Link class="nav-link" to="/login">Login</Link>
                                        </li>

                                    </ul>
                                </div>
                            </div>

                        </nav>
                        <Route path="/inscription" component={Inscription}></Route>
                    </div>

                </Router>


                <div class="container">

                </div>

            </div>
        );
    }
}
